import styled from "styled-components";

export const ContainerLeft = styled.div`
  display: flex;
  flex-direction: column;
  position: relative;
  padding-top: 4rem;
  transition: all 300ms ease;
  h2{
    font-size:2.5rem;
  }

  ul li{
    list-style:none;
    line-height:20px;
    
    
    a{
      text-decoration:none;
      color:var(--black);
      font-size:18px;
      gap:1.5rem;
    }
  }
`
